/** @format */

import React from "react";
import styled from "styled-components";

const FisrtBlock = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin: 0 auto;
  max-width: 768px;
  height: 100vh;
  padding: 60px 30px;
`;
const First = () => {
  return (
    <>
      <FisrtBlock>기본 페이지</FisrtBlock>
    </>
  );
};

export default First;
